import { Button } from 'react-native-paper';
import { FaBeer } from 'react-icons/fa';



export default function App() {
  return (
    <View>
      <View style={{ padding: '10%' }}>
        <Button style={{ marginTop: '25%', width: '50%' }} mode="contained" onPress={() => console.log('Pressed')}>
        <FaBeer />
        </Button>
      </View>
    </View>
  );
}
